export const ItemsVariants = {
    start: { opacity: 0 },
    stop: { 
        opacity: 1,
        transition: { 
            duration: 1,
            when: "beforeChildren", // Does the animation before the child element animations begins
            staggerChildren: 2,   // Makes each child wait for previous child for x seconds, beofre the next child animation
        }
    },
}
